// src/Participants.js
import React, { useState, useEffect } from 'react';

function Participants() {
  // 1. Initialize state to hold the session data
  const [sessionName, setSessionName] = useState("");
  const [fullSavePath, setFullSavePath] = useState("");
  const [sessionId, setSessionId] = useState("");

  // 2. Use the useEffect hook to fetch data from localStorage when the component mounts
  useEffect(() => {
    // Retrieve the data saved from the SessionInitialization component
    const storedSessionName = localStorage.getItem('sessionName');
    const storedBaseSavePath = localStorage.getItem('baseSavePath');
    const storedSessionId = localStorage.getItem('sessionId');

    // 3. Update the component's state with the retrieved data
    if (storedSessionName) {
      setSessionName(storedSessionName);
    }
    if (storedBaseSavePath) {
      setFullSavePath(storedBaseSavePath);
    }
    if (storedSessionId) {
      setSessionId(storedSessionId);
    }
  }, []); // The empty dependency array ensures this runs only once

  return (
    <div style={{ padding: "2rem" }}>
      <h2>Participants Management</h2>
      <p>Manage participant information for your sessions here.</p>

      {/* 4. Display the session ingestion data */}
      <div style={{
        border: '1px solid #ccc',
        padding: '1rem',
        marginTop: '1rem',
        backgroundColor: '#f9f9f9'
      }}>
        <h3 style={{ marginTop: "0", marginBottom: "1rem" }}>Current Session Details</h3>
        <p><strong>Session Name:</strong> <code>{sessionName || "Not Available"}</code></p>
        <p><strong>Session ID:</strong> <code>{sessionId || "Not Available"}</code></p>
        <p><strong>Full Save Path:</strong> <code>{fullSavePath || "Not Available"}</code></p>
      </div>

      <h3 style={{ marginTop: "2rem" }}>Add New Participant</h3>
      <form style={{ display: "flex", flexDirection: "column", gap: "1rem", maxWidth: "400px" }}>
        <div>
          <label htmlFor="participant-id">Participant ID:</label>
          <input type="text" id="participant-id" name="participant-id" style={{ marginLeft: "0.5rem", padding: "8px" }} />
        </div>
        <div>
          <label htmlFor="age">Age:</label>
          <input type="number" id="age" name="age" style={{ marginLeft: "0.5rem", padding: "8px" }} />
        </div>
        <div>
          <label htmlFor="gender">Gender:</label>
          <select id="gender" name="gender" style={{ marginLeft: "0.5rem", padding: "8px" }}>
            <option value="">Select...</option>
            <option value="male">Male</option>
            <option value="female">Female</option>
            <option value="other">Other</option>
            <option value="prefer_not_to_say">Prefer not to say</option>
          </select>
        </div>
        <div>
          <label htmlFor="height">Height (cm):</label>
          <input type="number" id="height" name="height" style={{ marginLeft: "0.5rem", padding: "8px" }} />
        </div>
        <div>
          <label htmlFor="weight">Weight (kg):</label>
          <input type="number" id="weight" name="weight" style={{ marginLeft: "0.5rem", padding: "8px" }} />
        </div>
        <button type="submit" style={{ padding: "10px 20px", fontSize: "1rem", marginTop: "1rem" }}>Save Participant</button>
      </form>

      <h3 style={{ marginTop: "3rem" }}>Existing Participants</h3>
      <p>List of participants will appear here...</p>
    </div>
  );
}

export default Participants;
